// src/Contact.js

import React from 'react';
import Navbar from './custom/Navbar';

const Contact = () => {
  return (
    <div>
      <Navbar/>
      <h1>Contact Page</h1>
      <p>This is the contact page.</p>
    </div>
  );
};

export default Contact;
